import React, { useState } from 'react';

const InvestmentResult = (props) => {
    console.log("RESULT" + props);
    return (
        <tr>
            <td>{props.data.yearNumber}</td>
            <td>{props.data.totalSavingsEndOfYear}</td>
            <td>{props.data.interestGainedInYear}</td>
            <td>{props.data.totalInterestGained}</td>
            <td>{props.data.totalInvestedCapital}</td>
        </tr>
    );

}

export default InvestmentResult;
